import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import { fetchData, login } from './api';
import Home from './components/Home';
import Mieszkaniec from './components/Mieszkaniec';
import Uchwala from './components/Uchwala';
import Harmonogram from './components/Harmonogram';
import Usterka from './components/Usterka';


const App = () => {
    const [data, setData] = useState([]);
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const handleLogin = async (e) => {
        e.preventDefault();
        const loginResult = await login(username, password);
        if (loginResult.token) {
            setIsLoggedIn(true);
        } else {
            alert('Login failed');
        }
    };

    return (
        <Router>
            <div>
                <nav>
                    <ul>
                        <li><Link to="/">Home</Link></li>
                        <li><Link to="/mieszkaniec">Mieszkaniec</Link></li>
                        <li><Link to="/uchwala">Uchwala</Link></li>
                        <li><Link to="/harmonogram">Harmonogram</Link></li>
                        <li><Link to="/usterka">Usterka</Link></li>
                    </ul>
                </nav>
                <Switch>
                    <Route path="/" exact component={Home} />
                    <Route path="/mieszkaniec" component={Mieszkaniec} />
                    <Route path="/uchwala" component={Uchwala} />
                    <Route path="/harmonogram" component={Harmonogram} />
                    <Route path="/usterka" component={Usterka} />
                </Switch>
            </div>
        </Router>
    );
};

export default App;
